import { Box, Button } from '@mui/material'
import React from 'react'

const HeaderSearch = () => {
    const btnSearch = {
        backgroundColor: "#93CD28",
        color: "black",
        fontWeight: "bold",
        marginRight: "20px",
        width: "500px",
        padding: "10px",
        "&:hover": {
          fontWeight: "bold",
          border: " solid #93CD28",
          color: "#93CD28",
          backgroundColor: "white",
        },
      };
      const btnClear = {
        backgroundColor: "#F68915",
        color: "black",
        fontWeight: "bold",
        padding: "10px",
        "&:hover": {
          fontWeight: "bold",
          border: " solid #F68915",
          color: "#F68915",
          backgroundColor: "white",
        },
      };
  return (
    <div>
          <Box sx={{ display: "flex", justifyContent: "center", padding: 2 }}>
        <Button sx={btnSearch} variant="contained">
          Search
        </Button>
        <Button variant="contained" sx={btnClear}>
          Clear
        </Button>
      </Box>
    </div>
  )
}

export default HeaderSearch
